The '''Gamwich family''' was a family of [[Hobbits]] from the town of [[Gamwich]] and then [[Tighfield]]. Through many generations, the family gave rise to the [[Roper family]] and the [[Gamgee family]] (which in turn would later give rise to the [[Fairbairn family]] and [[Gardner family]]).<ref>{{App|Gamgee}}</ref>

